import React from "react";

export default function FamousPicture()
{
    return (
        <div>
            <h2></h2>
            <img className="famous-pic" src="https://donttakefake.com/wp-content/uploads/2022/04/gernika-pikasso-dtf-magazine10-scaled.jpeg"/>
        </div>
    );
}
